          <h1>{quiz.question}</h1>
          <p>{answers.answer_a}</p>
          <p>{answers.answer_b}</p>
          <p>{answers.answer_c}</p>
          <p>{answers.answer_d}</p>
          <p>{answers.answer_e}</p>
          <p>{answers.answer_f}</p>
          <hr />
        </div>
      ))}
    </>
  );
};

export async function getServerSideProps() {


  const result = await axios.get('https://quizapi.io/api/v1/questions', {

    headers: { 'X-Api-Key': process.env.tokenAPI },

  });

  const quiz = result.data;

  return { props: { quiz } };
};

export default Quiz;
